Environmental Science for Students Series

Environmental Science for Students provides a fascinating look at Earth's environment and some of the most important environmental issues of our time. From the quality of the air that we breathe and water that we drink to the lasting effects of our reliance upon fossil fuels to power our lives, everyone is affected by environmental change. Accurate explanations, global examples and balanced viewpoints guide students in an exploration of topics that range from global climate change to the degradation of soil. Environmental experts speak about topics of interest, and noteworthy case studies showcase real-world examples. 

